// Optimized shuffleArray function to use less memory
function shuffleArray(array) {
    let currentIndex = array.length, temporaryValue, randomIndex;

    while (currentIndex !== 0) {
        randomIndex = Math.floor(getSecureRandomNumber() * currentIndex);
        currentIndex--;

        // Swap elements
        temporaryValue = array[currentIndex];
        array[currentIndex] = array[randomIndex];
        array[randomIndex] = temporaryValue;
    }
    return array;
}

function randomIntFromInterval(min, max) { // min and max included 
    return Math.floor(getSecureRandomNumber() * (max - min + 1)) + min;
}

function scalerFunction(startIndex, endIndex) {
    let partitions = [];
    let step = Math.floor((endIndex - startIndex + 1) / 21);
    let remainder = (endIndex - startIndex + 1) % 21;

    for (let i = 0; i < 21; i++) {
        let start = startIndex + i * step + Math.min(i, remainder);
        let end = startIndex + (i + 1) * step + Math.min(i + 1, remainder) - 1;
        partitions.push([start, end]);
    }

    let frequencyArray = [0.67, 0.67, 1.34, 2.01, 3.35, 5.36, 8.71, 14.07, 22.78, 36.85, 59.63, 96.48, 154.61, 250.86, 407.95, 663.61, 1071.54, 1735.15, 2806.69, 4534.23, 10000];
    shuffleArray(frequencyArray);

    function pickRandomPartition() {
        let total = frequencyArray.reduce((a, b) => a + b, 0);
        let random = getSecureRandomNumber() * total;
        let cumulative = 0;

        for (let i = 0; i < frequencyArray.length; i++) {
            cumulative += frequencyArray[i];
            if (random < cumulative) {
                return partitions[i];
            }
        }
    }

    let selectedPartition = pickRandomPartition();

    return {
        partitions: partitions,
        selectedPartition: selectedPartition
    };
}

function openStuff() {
    const startIndex = 1;
    const endIndex = links2.length;

    const selectedPartition = scalerFunction(startIndex, endIndex)["selectedPartition"];
    let randomInt = randomIntFromInterval(selectedPartition[0], selectedPartition[1]);
    window.open(links2[randomInt - 1]);
}

window.onload = function() {
    document.getElementById('randomButton').click();
}
